VALUES ('4061458027915', 'Frühstück Becher', 'Dessert mit Joghurt, Roter Grütze und Knuspermüsli mit Cornflakes und Mandeln Zutaten Dessert mit Joghurt und Roter Grütze (91 %): Joghurt (68 %), Sauerkirschen (9 %), Zucker, Erdbeeren (5%), rote Johannisbeeren (5%), schwarze Johannisbeeren (2 %), modifizierte Stärke,Milcheiweißerzeugnis, Heidelbeeren (0,3%), Speisegelatine (Rind), Johannisbeersaftkonzentrat, Säuerungsmittel: Citronensäure. Zutaten Knuspermüsli mit Cornflakes und Mandeln (9 %): Hafervollkornflocken (41%), Cornflakes (28 %) (Mais, Speisesalz, Gerstenmalzextrakt, Emulgator: Lecithine), Zucker, Glukosesirup, Sonnenblumenöl, Weizenvollkornmehl, gehackte Mandeln (2 %), Honig, Speisesalz, Aroma, Antioxidationsmittel: stark tocopherol - haltige Extrakte.', 'https://static.openfoodfacts.org/images/products/406/145/802/7915/front_de.4.400.jpg', '3.2', '1.5', '18.8', '11.2', '', '', '0.2', '0.078740157480315', '', '1');

