VALUES ('4061458027922', 'Dessert mi Joghurt Kirschen und Double Chocolatr Crunch Müsli', 'Dessert mit Joghurt, Sauerkirschen und Knuspermüsli mit Schokolade Zutaten Dessert mit Joghurt und Sauerkirschen (91 %)  Joghurt (68 % ), Sauerkirschen (20 %), Zucker, modifizierte Stärke, Speisegelatine (Rind), Milcheiweißerzeugnis, Sauerkirschsaftkonzentrat, Zimt, Säuerungs - mittel: Citronensäure.  Zutaten Knuspermüsli mit Schokolade (9 %): Hafervollkornflocken (47%), Getreide-Extrudat (Reismehl, Weizenvoll - kornmehl, Weizenmehl, Weizenkeime, Zucker, Gerstenmalzextrakt), Zartbitterschokolade (8 %) (Kakaomasse, Zucker,Kakaobutter, Emulgator: Lecithine), Sonnenblumenöl, Vollmilchschokolade (76) (Zucker, Kakao - masse, Vollmilchpulver, Kakaobutter, Emulgator: Lecithine), Zucker, Oligofruktose,Weizenkeime, Glukose-Fruktose-Sirup, Honig, Speisesalz, Magermilchpulver, Aroma, Antioxidationsmittel stark tocopherolhaltige Extrakte. Kann Spuren von Erdnüssen, Schalenfrüchten (Nüsse), Sesam und Soja enthalten. Trotz größter Sorgfalt ist nicht auszuschließen, dass Steine oder Teile davon enthalten sein können. Unter Schutzatmosphäre verpackt. Ungeoffnet bei unter +7 °C mindestens haltbar bis: siehe Aufdruck Becherseite Dessert mit Joghurt und Sauerkirschen+Müsli Ar', 'https://static.openfoodfacts.org/images/products/406/145/802/7922/front_de.3.400.jpg', '3.5', '1.7', '19', '13', '', '3.8', '0.15', '0.0590551181102362', '', '1');

